//import React from 'react';
import './Header.min.css';
import { FaDumbbell } from 'react-icons/fa';
import { useState } from 'react';


export const Header = () => {
  const [status, setStatus] = useState('Login')
  return (
    <>
    <header id = "wrapper">
      <h1>Fitify <FaDumbbell /></h1>
        <nav>
          <ul id = "nav_links">
            <li>Home</li>
            <li>{status}</li>
            <li>Statistics</li>
          </ul>
        </nav>
    </header>
    </>
  )
}
